import React, { Component } from "react";
import MapView, { Marker } from 'react-native-maps';
import PolylineDirection from '@react-native-maps/polyline-direction';
import styles from "./style";
import Color from "../../Config/Color";
import { View, StatusBar, Image, Text, TouchableOpacity } from "react-native";
import container from "../../Styles/Container/style";
import Back from "../../Component/Back/index";
import Button from "../../Component/Button/index";
import Modal from "react-native-modal";
import AsyncStorage from '@react-native-community/async-storage';
export default class index extends Component {
  constructor(props) {

    super(props)


    var plats = ""
    var plongs = ""
    var dlats = ""
    var dlongs = ""
    var daddresss = ""
    var pstreets = ""

    this.state = {
      isModalVisible: false,

    }
  };


  _toggleModal = () =>
    this.setState({ isModalVisible: !this.state.isModalVisible });
  _toggleModal2 = () =>
    this.props.navigation.navigate("Home", this._toggleModal);





  render() {

    plats = this.props.navigation.state.params.platitude
    plongs = this.props.navigation.state.params.plongitude
    dlats = this.props.navigation.state.params.dlatitude
    dlongs = this.props.navigation.state.params.dlongitude
    daddresss = this.props.navigation.state.params.deaddress
    pstreets = this.props.navigation.state.params.pestreet
    ride = this.props.navigation.state.params.Ride
    prices = this.props.navigation.state.params.Prices


    const origin = { latitude: plats, longitude: plongs };
    const destination = { latitude: dlats, longitude: dlongs };

    return (
      // Main View
      <View style={container.container}>
        <StatusBar barStyle="dark-content" />
        <MapView
          style={{ flex: 1 }}
          initialRegion={{
            latitude: plats,
            longitude: plongs,
            latitudeDelta: 0.0922,
            longitudeDelta: 0.0421
          }}>

          <Marker
            coordinate={{
              latitude: plats,
              longitude: plongs
            }}
            title="Pick up"
          >
            <Text style={{ backgroundColor: '#fff', fontWeight: 'bold', padding: 7 }}>Pick up</Text>
            <Image
              source={require("../../Image/pin2.png")}
              style={{
                width: 50,
                height: 50,
                alignSelf: "center",
                resizeMode: "contain"
              }}
            />
          </Marker>
          <Marker
            coordinate={{
              latitude: dlats,
              longitude: dlongs
            }}
            title="Drop Off"
          >
            <Text style={{ backgroundColor: '#fff', fontWeight: 'bold', padding: 7 }}>Drop Off</Text>
            <Image
              source={require("../../Image/pin.png")}
              style={{
                width: 50,
                height: 50,
                alignSelf: "center",
                resizeMode: "contain"
              }}
            />
          </Marker>




          <PolylineDirection
            origin={origin}
            destination={destination}
            apiKey="AIzaSyD-n60W2PvXoXg4tTJhDy6JrhuLgIQMOYY"
            strokeWidth={4}
            strokeColor="#12bc00"
          />

        </MapView>
        <Back onPress={() => this.props.navigation.navigate("BookingReq")} />
        {/* sub view */}
        <View style={styles.container}>
          <View style={styles.subContainerView}>
            <View style={{ margin: 15 }}>
